INSERT INTO `habitats` VALUES (10,2,'D√©sert du Sahara','Plongez dans les paysages arides et myst√©rieux du d√©sert du Sahara. Apprenez comment les animaux survivent dans cet environnement extr√™me, entre dunes et oasis.','https://my-zoo-images.s3.eu-north-1.amazonaws.com/Images_habitats/desert_sahara.webp','2024-06-17 17:05:37','2024-06-17 17:05:37'),(11,2,'Savane Africaine','Explorez les vastes plaines de la savane africaine, o√π la nature s‚Äô√©tend √† perte de vue. Vous pourrez y d√©couvrir les majestueux lions, les rapides gu√©pards, et bien d\'autres animaux embl√©matiques de cette r√©gion.','https://my-zoo-images.s3.eu-north-1.amazonaws.com/Images_habitats/savane_africaine.webp','2024-06-17 17:05:37','2024-06-17 17:05:37'),(12,2,'For√™t Tropicale','Entrez dans l\'univers luxuriant de la for√™t tropicale, un √©cosyst√®me dense et humide. D√©couvrez une incroyable diversit√© d\'animaux exotiques et color√©s parmi les lianes et les arbres g√©ants.','https://my-zoo-images.s3.eu-north-1.amazonaws.com/Images_habitats/Foret_tropicale.webp','2024-06-17 17:05:37','2024-06-17 17:05:37'),(13,2,'Rivi√®re Amazonienne','Parcourez les m√©andres de la rivi√®re Amazonienne, la plus grande for√™t tropicale du monde. Admirez une faune aquatique spectaculaire et des cr√©atures terrestres uniques.','https://my-zoo-images.s3.eu-north-1.amazonaws.com/Images_habitats/riviere_amazoniene.webp','2024-06-17 17:05:37','2024-06-17 17:05:37'),(14,2,'Montagnes Rocheuses','Gravissez les hauteurs des Montagnes Rocheuses, o√π les sommets enneig√©s rencontrent les for√™ts alpines. D√©couvrez les animaux adapt√©s √† la vie en altitude.','https://my-zoo-images.s3.eu-north-1.amazonaws.com/Images_habitats/montagne_rocheuse.webp','2024-06-17 17:05:37','2024-06-17 17:05:37'),(15,2,'Oc√©an Pacifique','Plongez dans les profondeurs de l\'Oc√©an Pacifique et d√©couvrez un monde sous-marin fascinant. Observez les poissons multicolores, les majestueuses tortues de mer et les impressionnants requins.','https://my-zoo-images.s3.eu-north-1.amazonaws.com/Images_habitats/ocean_pacifique.webp','2024-06-17 17:05:37','2024-06-17 17:05:37'),(16,2,'For√™t Bor√©ale','Explorez les vastes √©tendues de la for√™t bor√©ale, une r√©gion froide mais riche en biodiversit√©. Rencontrez des animaux robustes et adapt√©s aux conditions hivernales.','https://my-zoo-images.s3.eu-north-1.amazonaws.com/Images_habitats/foret_boreale.webp','2024-06-17 17:05:37','2024-06-17 17:05:37'),(17,2,'Prairie des Grandes Plaines','Parcourez les vastes √©tendues des Grandes Plaines, un √©cosyst√®me riche en biodiversit√© avec des prairies infinies et des collines ondulantes. Rencontrez des bisons majestueux, des renards rus√©s et une multitude d\'autres esp√®ces fascinantes.','https://my-zoo-images.s3.eu-north-1.amazonaws.com/Images_habitats/prairie.webp','2024-06-17 17:05:37','2024-06-17 17:05:37');
